import React from 'react';
import { makeStyles, Theme, createStyles } from '@material-ui/core/styles';
import Modal from '@material-ui/core/Modal';
import Backdrop from '@material-ui/core/Backdrop';
import Fade from '@material-ui/core/Fade';
import VisibilityIcon from '@material-ui/icons/Visibility';
import '../../../../pages/reset.scss';

const useStyles = makeStyles((theme: Theme) =>
	createStyles({
		modal: {
			display: 'flex',
			alignItems: 'center',
			justifyContent: 'center',
		},
	}),
);

export const InformationStore = () => {
	const classes = useStyles();
	const [open, setOpen] = React.useState(false);

	const handleOpen = () => {
		setOpen(true);
	};

	const handleClose = () => {
		setOpen(false);
	};
	const [checked, setChecked] = React.useState(true);
	return (
		<div>
			<button type='button' onClick={handleOpen}>
				<VisibilityIcon />
			</button>
			<Modal
				aria-labelledby='transition-modal-title'
				aria-describedby='transition-modal-description'
				className={classes.modal}
				open={open}
				onClose={handleClose}
				closeAfterTransition
				BackdropComponent={Backdrop}
				BackdropProps={{
					timeout: 500,
				}}
			>
				<Fade in={open}>
					<div className=' form-modal informationStore'>
						<div className='form-modal__title'>
							<h3>Thông Tin Cơ Bản</h3>
						</div>
						<div className='form-modal__content'>
							<div className='informationStore__item'>
								<label htmlFor=''>Giới thiệu ngắn</label>
								<div className='content'></div>
							</div>
							<div className='informationStore__item'>
								<label htmlFor=''>Mô tả chi tiết</label>
								<div className='content'></div>
							</div>
							<div className='informationStore__item'>
								<label htmlFor=''></label>
								<div className='content'></div>
							</div>
							<div className='informationStore__item'>
								<label htmlFor=''></label>
								<div className='content'></div>
							</div>
						</div>
					</div>
				</Fade>
			</Modal>
		</div>
	);
};
